I've had pretty good experiences with OpenSearch, which can scale horizontally as much as you want, just make sure to pick a reasonable shard size to begin with.  Amongst other things, the embeddings property would be set to something like:
```
        "video_embeddings": {
            "type": "knn_vector",
            "dimension": 1024,
            "method": {
                "name": "hnsw",
                "engine": "faiss",
                "space_type": "l2",
                "parameters": {
                    "m": 64,
                    "ef_construction": 512,
                },
            },
        },
```
Then, you can also index the text fields, and use a hybrid search instead of just semantic similarity.

Search would look like:
```
        {
            "query": {
                "hybrid": {
                    "queries": [
                        {
                            "knn": {
                                "video_embeddings": {
                                    "vector": [...],
                                    "k": 10,
                                    "filter": {...}
                                },
                            },
                        },
                        {
                            "function_score": {
                                "functions": {...},
                                "query": {
                                    "bool": {
                                        "must": [
                                            {
                                                "multi_match": {
                                                    "query": context,
                                                    "fields": [
                                                        "title",
                                                        "description",
                                                    ],
                                                },
                                            },
                                        ] + [{any other filters, e.g. date, view count, etc.]
                                    }
                                },
                            },
                        },
                    ],
                },
            },
            "size": 10
        }
```

Then you add a search processor to provide a normalized score that combines the bm25 phase with vector phase of search (50/50 weight here, but could be anything):
```
    "phase_results_processors": [
        {
            "normalization-processor": {
                "normalization": {"technique": "min_max"},
                "combination": {
                    "technique": "arithmetic_mean",
                    "parameters": {"weights": [0.5, 0.5]},
                },
            }
        }
    ],
```
